package application;

public class Exchanges {
	String ExID;
	String ExFrom;
	String ExFromID;
	String ExDes;
	String ExDay;
	String ExMonth;
	String ExYear;
	String ExMuch;
	String ExCyrr;
	public Exchanges() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Exchanges(String exID, String exFrom, String exFromID, String exDes, String exDay, String exMonth,
			String exYear, String exMuch, String exCyrr) {
		super();
		ExID = exID;
		ExFrom = exFrom;
		ExFromID = exFromID;
		ExDes = exDes;
		ExDay = exDay;
		ExMonth = exMonth;
		ExYear = exYear;
		ExMuch = exMuch;
		ExCyrr = exCyrr;
	}
	public String getExID() {
		return ExID;
	}
	public void setExID(String exID) {
		ExID = exID;
	}
	public String getExFrom() {
		return ExFrom;
	}
	public void setExFrom(String exFrom) {
		ExFrom = exFrom;
	}
	public String getExFromID() {
		return ExFromID;
	}
	public void setExFromID(String exFromID) {
		ExFromID = exFromID;
	}
	public String getExDes() {
		return ExDes;
	}
	public void setExDes(String exDes) {
		ExDes = exDes;
	}
	public String getExDay() {
		return ExDay;
	}
	public void setExDay(String exDay) {
		ExDay = exDay;
	}
	public String getExMonth() {
		return ExMonth;
	}
	public void setExMonth(String exMonth) {
		ExMonth = exMonth;
	}
	public String getExYear() {
		return ExYear;
	}
	public void setExYear(String exYear) {
		ExYear = exYear;
	}
	public String getExMuch() {
		return ExMuch;
	}
	public void setExMuch(String exMuch) {
		ExMuch = exMuch;
	}
	public String getExCyrr() {
		return ExCyrr;
	}
	public void setExCyrr(String exCyrr) {
		ExCyrr = exCyrr;
	}
	

}
